import React from "react";
import MenuItem from "../MenuItems";
import css from "./style.module.css"
const Menu = () => {
  return (
    <div>
      <ul className={css.Menu}>
        <MenuItem>БУРГЕР</MenuItem>
        <MenuItem>ТӨЛБӨР</MenuItem>
      </ul>
    </div>
  );
};
export default Menu;
